import React from "react";

import Groups from "../components/Groups";
import Lists from "../components/Lists";

const Community = () => {
    return(
        <main class="m-5">
                <Groups/>

                <div class="row m-5"></div>

                <Lists/>
            </main>
    );
};

export default Community;
